import Countdown from "../Layout/Common/Countdown";
import SignInForm from '../Layout/SignIn/SignInForm';
import FooterMessage from '../Layout/Common/FooterMessage';
import HeaderMessage from '../Layout/Common/HeaderMessage';
import React, { useState } from 'react';


export function SignedOutPage(props) {

    const [openForm, setOpenForm] = useState(false);

    return (
        <div className="signedOut" >
            <div className="container">
                <Countdown />
                <HeaderMessage />
                {
                    openForm ?
                        <SignInForm setResponse={props.setResponse}
                            setName={props.setName}
                            setAuth={props.setAuth} />
                        :
                        <p className="signInButton"
                            onClick={setOpenForm(true)}>
                            Join Us
                        </p>
                }
                <FooterMessage />
            </div>
        </div >
    );
}
